import React, { useState, useEffect } from "react";
import "./App.css";

function Index() {
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetch("http://localhost:8000/")  // replace with Databricks public endpoint if hosted
      .then((res) => res.json())
      .then((data) => setMessage(data.message))
      .catch((err) => console.error(err));
  }, []);

  return (
<div className="App">
<h1>React + FastAPI + Databricks Index</h1>
<p>{message}</p>
</div>
  );
}

export default Index;
